description:
Time Dreamer: Temporal Betrayal - Wendy99


Genre: Hidden Object | Puzzle


After joining a research team you are sent out to mine valuable krawtite in Time Dream: Temporal Betrayal! Before the mission can get underway, the entire 
operation crashes on the runway. Use your Time Dream skills to find the saboteur and prevent the deadly accident from occurring again in this incredible Hidden Object game. Invistigate a 60s flower child, a gruff professor, and an annoying slob as you try to track down the criminal in Time Dream: Temporal Betrayal!


Investigate your team
Prevent the deadly explosion
Hunt down the saboteur!


System Requirements:


OS: Windows XP | Windows Vista | Windows 7
CPU: 1.2 GHz
RAM: 1024 MB
DirectX: 9.0
Hard Drive: 428 MB


Install and play


